function Schedule(props){
    const sampleObject  = [
        {
            "task":"Sample Task",
            "time":"21:50",
            "status":"status"
        },{
            "task":"Sample Task2",
            "time":"22:50",
            "status":"status"
        },{
            "task":"Sample Task3",
            "time":"23:50",
            "status":"status"
        }
    ]
    props.changePage("schedule")
    return(
        <div className="grid place-items-center">
        <table className="table-auto max-w-4xl">
  <thead>
    <tr>
      <th className="w-1/2 ...">Time</th>
      <th className="w-1/4 ...">Task</th>
      <th className="w-1/4 ...">Status</th>
    </tr>
  </thead>
  <tbody>
    {
        sampleObject.map((o)=>{
        return (
            <tr className="bg-blue-200">
      <td>{o.time}</td>
      <td>{o.task}</td>
      <td>{o.status}</td>
    </tr> 

        )
        }
        )

}
  </tbody>
</table>
</div>
    )
}

export default Schedule;
